function alchemicalReduction(array, length) {
  const polymer = [...array];
  for (let i = 0; i < polymer.length; i++) {
    const curr = polymer[i];
    const next = polymer[i + 1];
    if (next === undefined) {
      break;
    }
    if (curr.toUpperCase() === next.toUpperCase()) {
      const isCurrUpper = curr === curr.toUpperCase();
      const isNextUpper = next === next.toUpperCase();
      if ((isCurrUpper && !isNextUpper) || (!isCurrUpper && isNextUpper)) {
        polymer.splice(i, 2);
        i - 2 < 0 ? (i = 0) : (i -= 2);
      }
    }
  }
  if (polymer.length === length) return polymer.length;
  return alchemicalReduction(polymer, polymer.length);
}
function fullReduce(array, letter) {
  const polymer = [...array];
  const reduced = polymer.filter(poly => poly.toLowerCase() !== letter);
  return alchemicalReduction(reduced, reduced.length);
}

const inputStr = ``;
const input = inputStr.split('');
const alphabet = 'abcdefghijklmnopqrstuvwxyz'.split('');

const reducedPolymers = alphabet.map(letter => fullReduce(input, letter));
console.log(Math.min(...reducedPolymers));
